                          [
                            _vm._v(
                              '<p>以前的演员他们大多数人之所以从事这个行业，都是因为热爱。</p><p>张译一开始其实是想做播音员的，结果连续两年没考上北京广播学院，被居委会大妈打上了待业标签（发待业证）。正感觉前路茫茫的时候，哈尔滨话剧学院刚巧在当地招表演学习班，父母亲戚就劝他去试试，反正都是搞文艺嘛，学点儿啥总比待业强，张译就去学了半年话剧。</p><img src="https://pic4.zhimg.com/v2-4745044237318e2549c13fe81fa9e457_b.jpg" data-caption="" data-rawwidth="527" data-rawheight="310" class="origin_image zh-lightbox-thumb" width="527" data-original="https://pic4.zhimg.com/v2-4745044237318e2549c13fe81fa9e457_r.jpg"><p>张译爱上了话剧，一门心思想考戏剧学院，中戏上戏人艺试了个遍，可惜一个都没考上。几经周折之后自费上了北京战友话剧团，20岁的张译终于如愿以偿的成为了一名话剧演员。</p><p>然而梦想很丰满，现实很骨感。成为了戏剧演员的张译并没有成为“演员”而是成了一个集十项全能于一身的打杂。</p><p>主要负责下部队时表演“双簧”，平时要兼职主持，负责装台卸台等一系列工作，就是每一件和演戏相关，没事儿还写点儿串场词什么的。</p><img src="https://pic4.zhimg.com/v2-14340c096ddfd202c5e1386010112baf_b.jpg" data-caption="" data-rawwidth="512" data-rawheight="427" class="origin_image zh-lightbox-thumb" width="512" data-original="https://pic4.zhimg.com/v2-14340c096ddfd202c5e1386010112baf_r.jpg"><p>张译想演戏，一直想演团里却不给他机会，甚至盖章张译是一个不会演戏的演员。他跑了五年剧组，剧组也不愿意给他机会。直到04年康洪雷导演给了他一次机会，让他在电视剧《民工》中演一个小配角。<br>也正是通过这次合作，康洪雷发现了他身上的闪光点，在拍《士兵突击》时把班长史今留给了他。</p><img src="https://pic3.zhimg.com/v2-7a8b38ebea2d72e750594c69d05abece_b.jpg" data-caption="" data-rawwidth="640" data-rawheight="480" class="origin_image zh-lightbox-thumb" width="640" data-original="https://pic3.zhimg.com/v2-7a8b38ebea2d72e750594c69d05abece_r.jpg"><p>当真正成为演员的时候，他比谁都用心，这是他热爱的舞台，必然不会用不好的表演去玷污它。<br>很多人总是不解为什么很多人总鼓吹话剧演员，觉得他们高一等。</p><p>真不是话剧演员高一等，而是话剧演员都是真的演员，他们表演不是为钱，而是为爱。</p><p>演话剧是真辛苦还不赚钱。领衔主演二到三人，每人每场1500元；主要演员，五到八人，每人每场1000元，无一例外。<b>与低薪资相对应的是高付出</b>，光排练就要两三个月，这时间够拍个四五十集电视剧了，而且演话剧期间别的啥都不能干，轧戏商演想都别想。</p><p>费劲巴拉排练仨月之后，演出一两周，赚不了三瓜俩枣，还要保证表演不能出任何差错，<b>费力、不赚钱还要承受巨大的心里压力，要不是真的爱，谁演这个啊？</b></p><img src="https://pic4.zhimg.com/v2-54f82bc582341bf8df3be1fbf937eaa7_b.jpg" data-caption="" data-rawwidth="594" data-rawheight="388" class="origin_image zh-lightbox-thumb" width="594" data-original="https://pic4.zhimg.com/v2-54f82bc582341bf8df3be1fbf937eaa7_r.jpg"><p>冯远征老师<b>一天24小时至少三分之二都献给了表演</b>，给演员训练台词，给学生做讲课，自己还要排练演出。</p><p>媒体上总写他批评这个，批评那个，什么三大表演体系是骗人的，小鲜肉演技不好老师也有责任之类的爆炸宣言，追根溯源，这其实是一个老艺术家对热爱的演绎事业的苦口良言。</p><img src="https://pic2.zhimg.com/v2-9f62c49e54d4dd910bce8fa5820a8401_b.jpg" data-caption="" data-rawwidth="600" data-rawheight="400" class="origin_image zh-lightbox-thumb" width="600" data-original="https://pic2.zhimg.com/v2-9f62c49e54d4dd910bce8fa5820a8401_r.jpg"><p><b>我们真的应该感谢这些坚持的戏剧、坚持热爱的演员们</b>，正是因为有他们在，我们才能在烂片横行的时代还有好剧可看，在浮躁社会里，他们是真正的清流。<b>星星之火可以燎原，清流总有一天会变成洪流。</b></p><p></p>'
                            )
                          ]
